sys_variable_value.value:
(function execute(inputs,outputs){
gs.include('x_8302_insubnet.inSubnetFunctions');
  var name = inputs.name;
  var address = inputs.address;
  var netmask = inputs.netmask;
  var sub_supernet = inputs.sub_supernet;
  var rec_id = inputs.rec_id;

  var isf = new x_8302_insubnet.inSubnetFunctions();
  isf.insertNetwork(name,address,netmask,sub_supernet,rec_id);
})(inputs,outputs);

